package qor

import (
	"net/http"

	"github.com/jinzhu/gorm"
)

// CurrentUser is an interface, which is used for qor admin to get current logged user
type CurrentUser interface {
	DisplayName() string
}

// Context qor context, which is used for many qor components, used to share information between them
type Context struct {
	Request     *http.Request
	Writer      http.ResponseWriter
	CurrentUser CurrentUser
	Roles       []string
	ResourceID  string
	DB          *gorm.DB
	Config      *Config
	Errors
}

// Clone clone current context
func (context *Context) Clone() *Context {
	var clone = *context
	return &clone
}

// GetDB get db from current context
func (context *Context) GetDB() *gorm.DB {
	if context.DB != nil {
		return context.DB
	}
	return context.Config.DB
}

// SetDB set db into current context
func (context *Context) SetDB(db *gorm.DB) {
	context.DB = db
}

package qor

import (
	"strings"
)

// Errors is a struct that used to hold errors array
type Errors struct {
	errors []error
}

// Error get formatted error message
func (errs Errors) Error() string {
	var errors []string
	for _, err := range errs.errors {
		errors = append(errors, err.Error())
	}
	return strings.Join(errors, "; ")
}

// AddError add error to Errors struct
func (errs *Errors) AddError(errors ...error) {
	for _, err := range errors {
		if err != nil {
			if e, ok := err.(errorsInterface); ok {
				errs.errors = append(errs.errors, e.GetErrors()...)
			} else {
				errs.errors = append(errs.errors, err)
			}
		}
	}
}

// HasError return has error or not
func (errs Errors) HasError() bool {
	return len(errs.errors) != 0
}

// GetErrors return error array
func (errs Errors) GetErrors() []error {
	return errs.errors
}

type errorsInterface interface {
	GetErrors() []error
}

"use strict";

let gulp = require("gulp"),
  babel = require("gulp-babel"),
  plumber = require("gulp-plumber"),
  cleanCSS = require("gulp-clean-css"),
  concat = require("gulp-concat"),
  sass = require("gulp-sass"),
  uglify = require("gulp-uglify"),
  fs = require("fs"),
  path = require("path"),
  es = require("event-stream"),
  rename = require("gulp-rename");

let moduleName = (function() {
  let args = process.argv,
    length = args.length,
    i = 0,
    name,
    subName,
    useSubName;

  while (i++ < length) {
    if (/^--+(\w+)/i.test(args[i])) {
      name = args[i].split("--")[1];
      subName = args[i].split("--")[2];
      useSubName = args[i].split("--")[3];
      break;
    }
  }
  return {
    name: name,
    subName: subName,
    useSubName: useSubName,
  };
})();

// Admin Module
// Command: gulp [task]
// Admin is default task
// Watch Admin module: gulp
// -----------------------------------------------------------------------------

function adminTasks() {
  let pathto = function(file) {
    return "../admin/views/assets/" + file;
  };
  let scripts = {
    src: pathto("javascripts/app/*.js"),
    dest: pathto("javascripts"),
    qor: pathto("javascripts/qor/*.js"),
    qorInit: pathto("javascripts/qor/qor-config.js"),
    qorCommon: pathto("javascripts/qor/qor-common.js"),
    qorAdmin: [pathto("javascripts/qor.js"), pathto("javascripts/app.js")],
    all: ["gulpfile.js", pathto("javascripts/qor/*.js")],
  };
  let styles = {
    src: pathto("stylesheets/scss/{app,qor}.scss"),
    dest: pathto("stylesheets"),
    vendors: pathto("stylesheets/vendors"),
    main: pathto("stylesheets/{qor,app}.css"),
    qorAdmin: [
      pathto("stylesheets/vendors.css"),
      pathto("stylesheets/qor.css"),
      pathto("stylesheets/app.css"),
    ],
    scss: pathto("stylesheets/scss/**/*.scss"),
  };

  gulp.task("qor", function() {
    return gulp
      .src([scripts.qorInit, scripts.qorCommon, scripts.qor])
      .pipe(plumber())
      .pipe(concat("qor.js"))
      .pipe(uglify())
      .pipe(gulp.dest(scripts.dest));
  });

  gulp.task(
    "js",
    gulp.series("qor", function() {
      return gulp
        .src(scripts.src)
        .pipe(plumber())
        .pipe(concat("app.js"))
        .pipe(uglify())
        .pipe(gulp.dest(scripts.dest));
    })
  );

  gulp.task("qor+", function() {
    return gulp
      .src([scripts.qorInit, scripts.qorCommon, scripts.qor])
      .pipe(plumber())
      .pipe(
        babel({
          presets: ["@babel/env"],
        })
      )
      .pipe(concat("qor.js"))
      .pipe(uglify())
      .pipe(gulp.dest(scripts.dest));
  });

  gulp.task("js+", function() {
    return gulp
      .src(scripts.src)
      .pipe(plumber())
      .pipe(
        babel({
          presets: ["@babel/env"],
        })
      )
      .pipe(concat("app.js"))
      .pipe(uglify())
      .pipe(gulp.dest(scripts.dest));
  });

  gulp.task("sass", function() {
    return gulp
      .src(styles.src)
      .pipe(plumber())
      .pipe(sass().on("error", sass.logError))
      .pipe(gulp.dest(styles.dest));
  });

  gulp.task(
    "css",
    gulp.series("sass", function() {
      return gulp
        .src(styles.main)
        .pipe(plumber())
        .pipe(cleanCSS())
        .pipe(gulp.dest(styles.dest));
    })
  );

  gulp.task("release_js", function() {
    return gulp
      .src(scripts.qorAdmin)
      .pipe(concat("qor_admin_default.js"))
      .pipe(gulp.dest(scripts.dest));
  });

  gulp.task("release_css", function() {
    return gulp
      .src(styles.qorAdmin)
      .pipe(concat("qor_admin_default.css"))
      .pipe(gulp.dest(styles.dest));
  });

  gulp.task(
    "release",
    gulp.series("qor+", "js+", "css", "release_js", "release_css")
  );

  let watcher = gulp.task("watch", function() {
    let watch_qor = gulp.watch(scripts.qor, gulp.series("qor+")),
      watch_js = gulp.watch(scripts.src, gulp.series("js+")),
      watch_css = gulp.watch(styles.scss, gulp.series("css"));

    gulp.watch(styles.qorAdmin, gulp.series("release_css"));
    gulp.watch(scripts.qorAdmin, gulp.series("release_js"));

    watch_qor.on("change", function(path, stats) {
      console.log(":==> File " + path + " was changed, running tasks...");
    });
    watch_js.on("change", function(path, stats) {
      console.log(":==> File " + path + " was changed, running tasks...");
    });
    watch_css.on("change", function(path, stats) {
      console.log(":==> File " + path + " was changed, running tasks...");
    });
  });

  gulp.task("default", gulp.series("watch"));
}

