      if (subModuleName == "admin") {
        return "../" + moduleName + "/views/assets/" + file;
      } else if (subModuleName == "enterprise") {
        return (
          "../../../enterprise.getqor.com/" +
          moduleName +
          "/views/themes/" +
          moduleName +
          "/assets/" +
          file
        );
      } else if (useSubName) {
        if (useSubName == "admin") {
          return (
            "../" + moduleName + "/" + subModuleName + "/views/assets/" + file
          );
        } else {
          return (
            "../" +
            moduleName +
            "/" +
            subModuleName +
            "/views/themes/" +
            subModuleName +
            "/assets/" +
            file
          );
        }
      } else {
        return (
          "../" +
          moduleName +
          "/" +
          subModuleName +
          "/views/themes/" +
          moduleName +
          "/assets/" +
          file
        );
      }
    }
    return (
      "../" + moduleName + "/views/themes/" + moduleName + "/assets/" + file
